import React, {useEffect, useState} from 'react';
import getGifDetail from '../../services/getGifDetail';
import axios from "axios";
import { useParams } from 'react-router-dom'


const GifDetail = () => {

  const getGifDetail = async (id, state) =>{
    const {data} = await axios.get(`https://rickandmortyapi.com/api/character/${id}`);
    return data;
}

  const params = useParams()
  const [gifDetail, setGifDetail] = useState(null);

  useEffect(()=>{
    getGifDetail(params.id).then(data =>{setGifDetail(data)});
    console.log(gifDetail)
  },[])


  

  return (
    <div className="gifDetail">
      <h1>Hola</h1>

    </div>
  );
}

export default GifDetail;
